import React, { useState, useEffect } from 'react';
import { Canvas } from '@react-three/fiber';
import { OrbitControls, Stars, Text } from '@react-three/drei';
import { motion } from 'framer-motion';
import './App.css';
import WhaleVisualization from './components/WhaleVisualization';
import DataPanel from './components/DataPanel';
import Controls from './components/Controls';
import DemoMode from './components/DemoMode';

function App() {
  const [whaleData, setWhaleData] = useState([]);
  const [summaryData, setSummaryData] = useState(null);
  const [blockData, setBlockData] = useState([]);
  const [config, setConfig] = useState({ threshold: 100, interval: 60 });
  const [isConnected, setIsConnected] = useState(false);

  useEffect(() => {
    // Connect to the Flask backend SSE stream
    const eventSource = new EventSource('/stream');
    
    eventSource.addEventListener('hello', () => {
      setIsConnected(true);
      fetchConfig();
    });

    eventSource.addEventListener('whale', (event) => {
      const data = JSON.parse(event.data);
      setWhaleData(prev => [data, ...prev.slice(0, 49)]); // Keep last 50
    });

    eventSource.addEventListener('summary', (event) => {
      const data = JSON.parse(event.data);
      setSummaryData(data);
    });

    eventSource.addEventListener('block', (event) => {
      const data = JSON.parse(event.data);
      setBlockData(prev => [data, ...prev.slice(0, 9)]); // Keep last 10
    });

    eventSource.addEventListener('config', (event) => {
      const data = JSON.parse(event.data);
      setConfig(data);
    });

    eventSource.onerror = () => {
      setIsConnected(false);
    };

    return () => eventSource.close();
  }, []);

  const fetchConfig = async () => {
    try {
      const response = await fetch('/config');
      const data = await response.json();
      if (data.threshold !== null && data.interval !== null) {
        setConfig(data);
      }
    } catch (error) {
      console.error('Failed to fetch config:', error);
    }
  };

  const updateConfig = async (newConfig) => {
    try {
      const response = await fetch('/config', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(newConfig)
      });
      const data = await response.json();
      setConfig(data);
    } catch (error) {
      console.error('Failed to update config:', error);
    }
  };

  const handleDemoData = (eventType, data) => {
    switch (eventType) {
      case 'whale':
        setWhaleData(prev => [data, ...prev.slice(0, 49)]);
        break;
      case 'summary':
        setSummaryData(data);
        break;
      case 'block':
        setBlockData(prev => [data, ...prev.slice(0, 9)]);
        break;
      default:
        break;
    }
  };

  return (
    <div className="App">
      {/* 3D Visualization Canvas */}
      <div className="canvas-container">
        <Canvas camera={{ position: [0, 0, 15], fov: 75 }}>
          <ambientLight intensity={0.4} />
          <pointLight position={[10, 10, 10]} intensity={1} />
          <Stars radius={100} depth={50} count={5000} factor={4} saturation={0} fade speed={1} />
          <WhaleVisualization 
            whaleData={whaleData}
            summaryData={summaryData}
            blockData={blockData}
            config={config}
          />
          <OrbitControls enablePan={true} enableZoom={true} enableRotate={true} />
        </Canvas>
      </div>

      {/* Overlay UI */}
      <div className="ui-overlay">
        <motion.div 
          className="header"
          initial={{ y: -100, opacity: 0 }}
          animate={{ y: 0, opacity: 1 }}
          transition={{ duration: 0.8 }}
        >
          <h1>🐋 WhaleWatch 3D</h1>
          <p>Real-time Bitcoin whale transaction monitoring</p>
          <div className={`connection-status ${isConnected ? 'connected' : 'disconnected'}`}>
            {isConnected ? '🟢 Connected' : '🔴 Disconnected'}
          </div>
        </motion.div>

        <div className="content-grid">
          <motion.div 
            className="left-panel"
            initial={{ x: -300, opacity: 0 }}
            animate={{ x: 0, opacity: 1 }}
            transition={{ duration: 0.8, delay: 0.2 }}
          >
            <Controls config={config} onUpdateConfig={updateConfig} />
            <DataPanel 
              summaryData={summaryData}
              blockData={blockData}
              whaleData={whaleData}
            />
          </motion.div>

          <motion.div 
            className="right-panel"
            initial={{ x: 300, opacity: 0 }}
            animate={{ x: 0, opacity: 1 }}
            transition={{ duration: 0.8, delay: 0.4 }}
          >
            <div className="info-card">
              <h3>🎯 What This Does</h3>
              <ul>
                <li>Monitors Bitcoin blockchain in real-time</li>
                <li>Detects large transactions ("whales")</li>
                <li>Tracks new blocks and network activity</li>
                <li>Provides live statistics and summaries</li>
                <li>Visualizes data flow in 3D space</li>
              </ul>
            </div>
            
            <div className="info-card">
              <h3>🎮 How to Interact</h3>
              <ul>
                <li>Drag to rotate the 3D view</li>
                <li>Scroll to zoom in/out</li>
                <li>Watch bubbles represent whale transactions</li>
                <li>Adjust threshold and interval settings</li>
                <li>Monitor real-time data panels</li>
              </ul>
            </div>
          </motion.div>
        </div>
      </div>
      
      {/* Demo Mode Component */}
      <DemoMode onDataUpdate={handleDemoData} />
    </div>
  );
}

export default App;
